import React, { Fragment } from "react";

function CurrentDeck({ OnClick }) {
  const currentDeck = {
    name: "Deck name",
    description: "a brief deck description",
  };

  const deckControlButtons = (
    <Fragment>
      <button className="btn btn-secondary" id="editDeck" onClick={OnClick}>
        Edit
      </button>
      <button className="btn btn-primary" id="studyDeck" onClick={OnClick}>
        Study
      </button>
      <button className="btn btn-primary" id="addCards" onClick={OnClick}>
        Add Cards
      </button>
      <button className="btn btn-danger" id="deleteDeck" onClick={OnClick}>
        Delete
      </button>
    </Fragment>
  );

  const cards = (
    <div class="card-group">
      <div class="card">
        <div class="card-body">
          <p class="card-text">
            Front of card text
          </p>
        </div>
      </div>
      <div class="card">
        <div class="card-body">
          <p class="card-text">
            This card has supporting text below as a natural lead-in to
            additional content.
          </p>
        </div>
      </div>
    </div>
  );

  return (
    <Fragment>
      <h4>{currentDeck.name}</h4>
      <p>{currentDeck.description}</p>
      {deckControlButtons}
      <h2>Cards</h2>
      {cards}
    </Fragment>
  );
}

export default CurrentDeck;
